import React from 'react';

const Feedback = ({ text, author, photo }) => {
  return (
    <div className='flex justify-around items-center space-x-8 w[70%] p-20'>
      <div className='w-[50%] content-center'>
          <img src={photo} alt="Feedback" className='w-[80%]' />
      </div>
      <div className='w-[50%]'>
          <p className=''>{text}</p>
          <p className='font-semibold'>- {author}</p>
      </div>
    </div>
  );
};

export default Feedback;
